CREATE TABLE migrate.Orders (
	order_id 			   serial NOT NULL,
	num_package_om         varchar(30) not null,
    num_cde_om             varchar(30) not null,
    customer_name          varchar(35),
	num_pos                varchar(10),
    code_transporter       varchar(8),
    origin                 varchar(5)  not null,
    date_expedition        timestamp,
    date_order             date,
    date_delivery_expected date,
    date_delivery_actual   date,
    date_mod               timestamp,
    date_cre               timestamp,
    PRIMARY KEY (order_id)
);

UPDATE migrate.Orders
SET customer_name='Jack'
where customer_name = 'Inconnu';

UPDATE migrate.Orders
SET date_cre = DATE(NOW())
where DATE(date_cre) is null;

UPDATE migrate.Orders
SET date_delivery_expected = DATE(DATE(date_cre) + 1)
where DATE(date_delivery_expected) is null;


